pragma solidity ^0.5.0;

// IMPORT HELPER CONTRACTS
import "./Users.sol";
import "./Devices.sol";

contract Main {

    // HELPER CONTRACT ADDRESSES
    address users_address;
    address devices_address;

    // CONSTRUCTOR
    constructor(address _users, address _devices) public {
        users_address = _users;
        devices_address = _devices;
    }

    // CONTRACT MASTER
    address private master = 0x0663713B3eBab96650b0B8b2a48015415538cd4c;

    // CHECK PERMISSION TO EXECUTE
    function permission(address sender) public view returns(bool) {

        // DEFAULT TO FALSE
        bool response = false;

        // IF SENDER IS MASTER, CHANGE TO TRUE
        if (sender == master) {
            response = true;
        }

        // RETURN RESPONSE
        return response;
    }

    function add_user(address _owner, string memory _name) public {
        Users(users_address).set(_owner, _name);
    }
}
